import React from "react";
import Users from "./components/users";
import { Route, Switch } from "react-router-dom";
import Home from "./components/pages/home";

function App() {
  return (
    <div>
      <Users />
      <Switch>
        <Route path={""} component={Home} />
        <Route />
        <Route />
      </Switch>
    </div>
  );
}

export default App;
